export async function fetchGlobalChartData() {

    const requestOption = {
        method: "GET",
        redirect: "follow",
        mode: 'cors'
    }

    try {
        const response = await fetch(`https://disease.sh/v2/historical/all`, requestOption)

        return response.ok ? response.json() : null
    } catch (err){
        console.log(err);
        return null;
    }
}
